import React, { Component } from "react";
import {  SideNavItem, Button, Icon } from "react-materialize";

class SideNavItems extends Component {
    render() {
        return (
            <div >
                <SideNavItem
                        user={{
                            background: "img/jeremy-bishop-BuQ-jgeexaQ-unsplash.jpg",
                            email: "jdandturk@gmail.com",
                            name: "John Doe"
                        }}
                        userView
                    />
                    <SideNavItem  href='#!icon' icon='cloud'>
                        First Link With Icon
                    </SideNavItem>
                    <SideNavItem href='#!second'>Is Second Link</SideNavItem>
                    <SideNavItem divider />
                    <SideNavItem subheader>Subheader</SideNavItem>
                    <SideNavItem href='#!third' waves>
                        Third Link With Waves
                    </SideNavItem>
            </div>
        )
    }
}

export default SideNavItems
